  `actionDescription` text NOT NULL COMMENT 'Human-readable description of the action',
  `targetType` enum('patient','user','medication','vaccine','appointment','checkup','report') DEFAULT NULL COMMENT 'Type of entity that was affected by the action',
  `targetId` int(11) DEFAULT NULL COMMENT 'ID of the entity that was affected',
  `targetName` varchar(255) DEFAULT NULL COMMENT 'Name/identifier of the affected entity',
  `metadata` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Additional data related to the action (medications, vaccines, etc.)' CHECK (json_valid(`metadata`)),
  `ipAddress` varchar(45) DEFAULT NULL COMMENT 'IP address of the user when action was performed',
  `userAgent` text DEFAULT NULL COMMENT 'Browser/client information',
  `sessionId` varchar(255) DEFAULT NULL COMMENT 'Session ID when action was performed',
  `timestamp` datetime NOT NULL COMMENT 'When the action was performed'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

