--
-- Table structure for table `audit_notifications`
--

CREATE TABLE `audit_notifications` (
  `id` int(11) NOT NULL,
  `userId` int(11) NOT NULL,
  `type` enum('critical','warning','info','success') NOT NULL DEFAULT 'info',
  `category` varchar(100) DEFAULT 'audit',
  `title` varchar(255) NOT NULL,
  `message` text NOT NULL,
  `relatedAction` varchar(100) DEFAULT NULL,
  `relatedId` int(11) DEFAULT NULL,
  `isRead` tinyint(1) DEFAULT 0,
  `readAt` datetime DEFAULT NULL,
  `expiresAt` datetime DEFAULT NULL,
  `createdAt` datetime DEFAULT current_timestamp(),
  `updatedAt` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

