CREATE TABLE `check_in_sessions` (
  `id` int(11) NOT NULL,
  `patientId` int(11) NOT NULL,
  `appointmentId` int(11) DEFAULT NULL,
  `checkInTime` datetime NOT NULL,
  `serviceType` varchar(255) DEFAULT 'General Checkup',
