  `status` enum('checked-in','vitals-recorded','doctor-notified','in-progress','transferred','started','completed','vaccination-completed','cancelled') DEFAULT 'checked-in',
  `checkInMethod` enum('qr-code','qr-scan','staff-assisted','online') DEFAULT 'staff-assisted',
  `vitalSigns` text DEFAULT NULL COMMENT 'JSON string containing vital signs data',
  `vitalSignsTime` datetime DEFAULT NULL,
  `doctorNotified` tinyint(1) DEFAULT 0,
  `notifiedAt` datetime DEFAULT NULL,
  `notes` text DEFAULT NULL,
  `completedAt` datetime DEFAULT NULL,
  `assignedDoctor` int(11) DEFAULT NULL,
  `startedAt` datetime DEFAULT NULL,
  `diagnosis` text DEFAULT NULL,
  `prescription` text DEFAULT NULL,
  `vaccination` text DEFAULT NULL COMMENT 'JSON string containing vaccination data',
  `doctorNotes` text DEFAULT NULL,
  `createdBy` int(11) DEFAULT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `chiefComplaint` text DEFAULT NULL COMMENT 'Primary reason for patient visit',
  `presentSymptoms` text DEFAULT NULL COMMENT 'Current symptoms described by patient',
  `treatmentPlan` text DEFAULT NULL COMMENT 'Prescribed treatment plan'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

