CREATE TABLE `medication_batches` (
  `id` int(11) NOT NULL COMMENT 'Unique batch record identifier',
  `medicationId` int(11) NOT NULL COMMENT 'Reference to parent medication',
  `batchNumber` varchar(50) NOT NULL COMMENT 'Unique batch identifier (e.g., PAR-1010, AMB-2024-001)',
  `quantityReceived` int(11) NOT NULL COMMENT 'Original quantity when batch was received',
  `quantityRemaining` int(11) NOT NULL COMMENT 'Current remaining quantity in this batch',
  `unitCost` decimal(10,2) NOT NULL COMMENT 'Cost per unit for this specific batch',
  `expiryDate` datetime NOT NULL COMMENT 'Expiration date for this specific batch',
  `receivedDate` datetime NOT NULL COMMENT 'Date when this batch was received in inventory',
  `supplier` varchar(100) DEFAULT NULL COMMENT 'Supplier or manufacturer of this batch',
  `purchaseOrderNumber` varchar(50) DEFAULT NULL COMMENT 'Reference to purchase order',
  `storageLocation` varchar(50) DEFAULT NULL COMMENT 'Physical storage location (e.g., Shelf A-1, Fridge B-2)',
  `status` enum('active','expired','recalled','depleted','quarantine') NOT NULL DEFAULT 'active' COMMENT 'Current status of this batch',
  `notes` text DEFAULT NULL COMMENT 'Additional notes about this batch',
  `createdBy` int(11) DEFAULT NULL COMMENT 'User ID who created this batch record',
  `lastUpdatedBy` int(11) DEFAULT NULL COMMENT 'User ID who last updated this batch',
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

