--
-- Table structure for table `prescription_records`
--

CREATE TABLE `prescription_records` (
  `id` int(11) NOT NULL,
  `prescriptionId` varchar(255) NOT NULL,
  `checkupSessionId` int(11) NOT NULL,
  `patientId` int(11) NOT NULL,
  `doctorId` int(11) DEFAULT NULL,
  `medications` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT 'Array of prescribed medications with details' CHECK (json_valid(`medications`)),
  `dateIssued` datetime NOT NULL,
  `datePickedUp` datetime DEFAULT NULL,
  `status` enum('issued','ready_for_pickup','picked_up','cancelled','expired') NOT NULL DEFAULT 'issued',
  `pickedUpBy` varchar(255) DEFAULT NULL COMMENT 'Name of person who picked up the prescription',
  `relationshipToPatient` varchar(255) DEFAULT NULL COMMENT 'Relationship of pickup person to patient',
  `staffIdWhoDispensed` int(11) DEFAULT NULL,
  `pharmacyNotes` text DEFAULT NULL,
  `totalCost` decimal(10,2) DEFAULT NULL,
  `isActive` tinyint(1) NOT NULL DEFAULT 1,
  `createdAt` datetime NOT NULL DEFAULT current_timestamp(),
  `updatedAt` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `checkInSessionId` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- --------------------------------------------------------

--
-- Table structure for table `users`
--

CREATE TABLE `users` (
  `id` int(11) NOT NULL,
  `username` varchar(255) NOT NULL,
  `email` varchar(255) DEFAULT NULL,
  `password` varchar(255) NOT NULL,
  `role` enum('patient','doctor','admin','staff','management') NOT NULL DEFAULT 'patient',
  `firstName` varchar(255) NOT NULL,
  `lastName` varchar(255) NOT NULL,
  `contactNumber` varchar(255) DEFAULT NULL,
  `isActive` tinyint(1) NOT NULL DEFAULT 1,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `position` varchar(255) DEFAULT NULL,
  `middleName` varchar(255) DEFAULT NULL,
  `accessLevel` int(11) DEFAULT 1
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

