CREATE TABLE `vaccinations` (
  `id` int(11) NOT NULL,
  `patientId` int(11) NOT NULL,
  `sessionId` int(11) DEFAULT NULL COMMENT 'References the checkup session if part of a checkup',
  `vaccineId` int(11) DEFAULT NULL COMMENT 'Reference to vaccine inventory (future implementation)',
  `vaccineName` varchar(255) NOT NULL COMMENT 'Name of the vaccine administered',
  `batchNumber` varchar(255) DEFAULT NULL COMMENT 'Batch number of the vaccine',
  `lotNumber` varchar(255) DEFAULT NULL COMMENT 'Lot number of the vaccine',
  `expiryDate` datetime DEFAULT NULL COMMENT 'Expiry date of the vaccine batch',
  `administrationSite` enum('left-arm','right-arm','left-thigh','right-thigh','oral','intranasal') NOT NULL DEFAULT 'left-arm' COMMENT 'Body site where vaccine was administered',
  `administrationRoute` enum('Intramuscular','Subcutaneous','Oral','Intranasal','Intradermal') NOT NULL DEFAULT 'Intramuscular' COMMENT 'Route of administration',
  `dose` varchar(255) NOT NULL DEFAULT '1' COMMENT 'Dose number (e.g., 1, 2, booster)',
  `administeredBy` varchar(255) NOT NULL COMMENT 'Name of healthcare provider who administered vaccine',
  `administeredAt` datetime NOT NULL COMMENT 'Date and time of administration',
  `category` enum('Routine Childhood','Adult','Adolescent','Annual','Emergency Use','Travel','Occupational') DEFAULT NULL COMMENT 'Category of vaccination',
  `notes` text DEFAULT NULL COMMENT 'Clinical notes or observations',
  `adverseReactions` enum('none','mild-pain','mild-swelling','mild-redness','other') NOT NULL DEFAULT 'none' COMMENT 'Any immediate adverse reactions observed',
  `adverseReactionNotes` text DEFAULT NULL COMMENT 'Details of adverse reactions if any',
  `consentGiven` tinyint(1) NOT NULL DEFAULT 1 COMMENT 'Whether patient/guardian consent was obtained',
  `nextDueDate` datetime DEFAULT NULL COMMENT 'Date when next dose is due (if applicable)',
  `createdBy` int(11) DEFAULT NULL COMMENT 'ID of user who created this record',
  `updatedBy` int(11) DEFAULT NULL COMMENT 'ID of user who last updated this record',
  `deletedAt` datetime DEFAULT NULL COMMENT 'Soft delete timestamp',
  `deletedBy` int(11) DEFAULT NULL COMMENT 'ID of user who deleted this record',
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

