CREATE TABLE `vaccine_batches` (
  `id` int(11) NOT NULL COMMENT 'Unique vaccine batch record identifier',
  `vaccineId` int(11) NOT NULL COMMENT 'Reference to vaccine ID in vaccines.json file (not database foreign key)',
  `vaccineName` varchar(255) NOT NULL COMMENT 'Vaccine name from JSON data for easier identification and querying',
  `batchNumber` varchar(50) NOT NULL COMMENT 'Unique batch identifier (e.g., BCG-2024-001, HEP-2025-010)',
  `lotNumber` varchar(50) DEFAULT NULL COMMENT 'Vaccine lot number for tracking and safety',
  `dosesReceived` int(11) NOT NULL COMMENT 'Original number of doses when batch was received',
  `dosesRemaining` int(11) NOT NULL COMMENT 'Current remaining doses in this batch',
  `unitCost` decimal(10,2) NOT NULL COMMENT 'Cost per dose for this specific batch',
  `expiryDate` datetime NOT NULL COMMENT 'Expiration date for this specific vaccine batch',
  `receivedDate` datetime NOT NULL COMMENT 'Date when this batch was received in inventory',
  `manufacturer` varchar(100) DEFAULT NULL COMMENT 'Manufacturer of this vaccine batch',
  `supplier` varchar(100) DEFAULT NULL COMMENT 'Supplier or distributor of this batch',
  `purchaseOrderNumber` varchar(50) DEFAULT NULL COMMENT 'Reference to purchase order',
  `storageLocation` varchar(50) DEFAULT NULL COMMENT 'Physical storage location (e.g., Cold Storage A-1, Freezer B-2)',
  `storageTemperature` varchar(20) DEFAULT NULL COMMENT 'Required storage temperature (e.g., 2-8¬∞C, -15¬∞C to -25¬∞C)',
  `vvmStage` enum('1','2','3','4') DEFAULT NULL COMMENT 'Vaccine Vial Monitor stage (1=good, 4=expired)',
  `status` enum('active','expired','recalled','depleted','quarantine','discarded') NOT NULL DEFAULT 'active' COMMENT 'Current status of this vaccine batch',
  `notes` text DEFAULT NULL COMMENT 'Additional notes about this batch (cold chain breaks, etc.)',
  `createdBy` int(11) DEFAULT NULL COMMENT 'User ID who created this batch record',
  `lastUpdatedBy` int(11) DEFAULT NULL COMMENT 'User ID who last updated this batch',
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

